INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'esMX', 'Infligidores de daño', '$bullet; Se debe ahuyentar a los propagadores de incendios de la banda. La explosión de la |cFF2959D3|Hspell:464983|h[Antorcha]|h|r es enorme e inflige un gran daño.\n$bullet; Los caminallamas lanzan |cFF2959D3|Hspell:470164|h[Infusión de magma]|h|r hasta que alguien los derrota, por lo que es más difícil recorrer la Cámara de Hierro.\n$bullet; Los jugadores deberán destruir los anclajes de los portales lo más rápido posible mientras evitan que los espíritus ardientes logren lanzar |cFF2959D3|Hspell:464769|h[Furia de las Tierras de Fuego]|h|r.', 57534),
(30900, 'esMX', 'Resumen', 'El emperador Dagran Thaurissan y la princesa Moira Barbabronce son dos combatientes formidables. Hay que controlar la |cFF2959D3|Hspell:466504|h[Palabra de las sombras: némesis]|h|r y la |cFF2959D3|Hspell:470599|h[Palabra de las sombras: necrosis]|h|r de Moira cuidadosamente para que no abrumen a la banda. Moira tratará de sanar a Dagran con |cFF2959D3|Hspell:470605|h[Infusión radiante]|h|r. \n\nDagran es un peligroso combatiente cuerpo a cuerpo que usa |cFF2959D3|Hspell:465077|h[Invocar guardia imperial]|h|r e |cFF2959D3|Hspell:465079|h[Invocar embajadores del Martillo Crepuscular]|h|r para expulsar a los invasores. Cuando Moira es derrotada, Dagran se transforma en un |cFF2959D3|Hspell:465069|h[Avatar de la Llama]|h|r poderoso, lo que mejora todas sus habilidades.\n\nSi cae presa de la desesperación, Dagran usa |cFF2959D3|Hspell:466332|h[Súplica al Señor del Fuego]|h|r para que lo salve. El avatar de Ragnaros causa una devastación que consume lentamente toda la sala con fuego fundido hasta que derroten a Dagran. Dagran ya no llamará a la guardia imperial ni a embajadores del Martillo Crepuscular para que lo ayuden cuando Ragnaros se una a la batalla.', 57534),
(31073, 'esMX', '', '', 57534),
(30986, 'esMX', 'Sección 24', '', 57534),
