(30722, 'esMX', 'Resumen', 'Lord Roccor lanza |cFF2959D3|Hspell:462351|h[Magma enturbiado]|h|r a su objetivo, inflige daño y proporciona la materia prima para |cFF2959D3|Hspell:463674|h[Cristalizar]|h|r su progenie obsidiana.\n\nCuando Lord Roccor alcance el 95% de salud, y cada 20% de daño recibido después de eso, lanzará |cFF2959D3|Hspell:462322|h[Erupción]|h|r y llenará la sala de |cFF2959D3|Hspell:462351|h[Magma enturbiado]|h|r. Cada |cFF2959D3|Hspell:462346|h[Magma viviente]|h|r que llegue a su destino aumentará el poder del elemental creado por |cFF2959D3|Hspell:462320|h[Cristalización ígnea]|h|r.\n\nAl llegar a 100 p. de energía, Roccor lanza |cFF2959D3|Hspell:462317|h[Brote volcánico]|h|r e inflige un gran daño a todos los jugadores.', 57534),
(5499, 'esMX', 'Fisura de las Sombras inferior', 'El brujo supremo Malbisal crea una fisura de Consumo bajo un jugador, lo que inflige $30498s1 p. de daño de las sombras cada $30498t1 s mientras esté dentro de la fisura.', 57534),
