(4910, 'esMX', 'Salva', 'Illyanna Roblecuervo dispara una lluvia de flechas a todos los jugadores en un área de $30933A1 m de diámetro. La lluvia inflige $448891s1 p. de daño arcano cada $448891t1 s durante $30933d.', 57534);
