(6762, 'esMX', '¡Descubre y analiza las runas ocultas de la zona!', 'Analiza las runas ocultas', 57534),
(6802, 'esMX', 'Limpia el polvo de los huesos para poder estudiarlos.', '¡Cepilla los huesos!', 57534),
