(6549, 'esMX', '', '¡Prepárate para la pelea!', 57534),
(6200, 'esMX', '¡Repara palas y déjalas listas para los demás archivistas!', 'Repara las palas', 57534),
(6584, 'esMX', '¡Derrota a los agentes despertados de Neltharion que lanzan emboscadas en la excavación!', 'Elimina agentes despertados', 57534),
(6578, 'esMX', '¡Descubre y analiza las runas ocultas de la zona!', 'Analiza las runas ocultas', 57534),
(6760, 'esMX', '¡Entrega un cajón de artefactos a Zenata para que los estudie!', 'Entrega para Zenata', 57534),
(6803, 'esMX', '¡Los biblioalfazaques amenazan nuestra investigación! Pisotéalos sin piedad.', '¡Pisotea biblioalfazaques!', 57534),
(6204, 'esMX', '¡El espíritu de Reposo del Traidor está atacando! ¡Debemos proteger la zona para excavar otro día!', '¡El fin de Reposo del Traidor!', 57534),
