(6191, 'esMX', 'Quédate cerca de Eadweard y aguarda sus instrucciones.', '¡Comienza la búsqueda del conocimiento!', 57534),
(6407, 'esMX', '¡Canaliza en los familiares nutria de Nirobin para liberar a sus contrapartes que buscan pistas!', '¡Libera a las nutrias!', 57534),
(6539, 'esMX', '¡Los djaradin antiguos se han levantado y están atacando! ¡Protege nuestra zona de su embate!', 'Expulsa a los espectros djaradin', 57534),
