(6201, 'esMX', '¡Rompe las rocas y deshazte de los fragmentos!', 'Rompe las rocas y deshazte de ellas', 57534),
(6195, 'esMX', '¡Marca y analiza las reliquias cerca del esqueleto!', 'Analiza las reliquias antiguas', 57534),
(6196, 'esMX', '¡Examina la tierra perturbada y desentierra artefactos!', 'Investiga la excavación', 57534),
