(6764, 'esMX', '¡Descubre y analiza las reliquias de la zona!', 'Analiza las reliquias antiguas', 57534),
(6805, 'esMX', 'Habla con Zenata para conseguir algunas runas y llevarlas al campamento principal.', '¡Runas de Zenata!', 57534),
(6553, 'esMX', '¡Prepara el equipo en una ubicación remota importante!', 'Prepara una excavación secundaria', 57534),
(6551, 'esMX', '¡Lleva sombreros a los archivistas tostados por el sol que trabajan en la zona para darles un respiro!', 'Protege a los archivistas tostados por el sol', 57534),
(6806, 'esMX', 'Habla con Nirobin para conseguir algunos libros y llevarlos al campamento principal.', '¡Libros de Nirobin!', 57534),
(6627, 'esMX', '¡Estamos en una buena racha! Quédate cerca de Eadweard y espera instrucciones. Llegaremos al fondo de este asunto.', '¡Cerca de un descubrimiento!', 57534),
(6199, 'esMX', '¡Cataloga las piedras entre las que tienen interés histórico y las comunes!', 'Separa las rocas importantes', 57534),
(6763, 'esMX', '¡Descubre y analiza las runas ocultas de la zona!', 'Analiza las runas ocultas', 57534),
