(6804, 'esMX', 'Habla con Roska para conseguir algunas palas y llevarlas al campamento principal.', '¡Palas de Roska!', 57534),
(6198, 'esMX', '¡Inspecciona las piedras de la zona para identificar las que tienen valor arqueológico!', 'Inspecciona piedras', 57534),
