(6541, 'esMX', '¡Los elementos atacan! ¡Protege nuestra zona de su embate!', 'Expulsa a los elementales perturbados', 57534),
(6543, 'esMX', '¡Usa a Hap\'he para conseguir pistas jugosas en la zona!', 'Atrapa pistas de la investigación', 57534),
